// SPDX-License-Identifier: UNLICENSED

pragma solidity >=0.6.0 <0.8.0;
// ABIEncoderV2 is necessary for returning structs in functions. This will be
// the default in 0.8.0 and is no longer experimental:
// https://blog.soliditylang.org/2020/12/16/solidity-v0.8.0-release-announcement/
pragma abicoder v2;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/math/SafeMathUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";

/// @author Will Papper and Syndicate Inc.
/// @title Syndicate management contract
contract Syndicate is OwnableUpgradeable, PausableUpgradeable {
    // Use OpenZeppelin SafeMath library for uint
    using SafeMathUpgradeable for uint256;

    // Use a consistent denominator for the profit share calculations
    uint256 constant PROFIT_SHARE_DENOMINATOR = 10000 ether;

    // This is a placeholder for Will's personal wallet and *must* be changed
    // before launch
    address constant SYNDICATE_FEE_ADDRESS =
        0xdd3767ABcAB26f261e2508A1DA1914053c7DDa78;

    // If you make any changes to SyndicateValues, ensure that you update
    // getSyndicateValues as well
    struct SyndicateValues {
        // The address used for tracking deposits. A stablecoin is recommended
        // since this is used to calculate ownership, and fluctations in value
        // can affect these ownership calculations
        address depositERC20ContractAddress;
        // The maximum amount that a single address can deposit. This is useful
        // when you want to restrict the amount that each wallet can deposit
        // into the fund to ensure that ownership is distributed among many
        // people. In the future, we can consider having a mapping that allows
        // you to set per-user deposit thresholds but this is better saved for
        // the asset management contract.
        uint256 maxDeposit;
        // The maximum amount that a fund can raise
        uint256 maxTotalDeposits;
        // The total deposits are used for calculating percentage stakes (e.g. ownership)
        uint256 totalDeposits;
        // When the Syndicate is closed, this date is automatically updated to the
        // date that it was closed. This date can be used for calculating
        // management fees.
        uint256 closeDate;
        uint256 syndicateProfitSharePercent;
        // A standard structure would be a 2% management fee and a 20%
        // performance fee. For more info, see:
        // https://www.investopedia.com/terms/t/two_and_twenty.asp
        uint256 managerManagementFeePercent;
        uint256 managerPerformanceFeePercent;
        // The threshold for distributions after which managers receive
        // performance fees
        // 0 is for the deposit ERC20 address, 1 is for all other ERC20
        // addresses
        uint256[2] managerPerformanceThreshold;
        address currentManager;
        // Used to transition ownership of a Syndicate. A new current manager needs
        // to claim the Syndicate after being assigned as a pending manager
        address pendingManager;
        // The manager must set a fee address that is different from the
        // manager's address. This is to avoid commingling the Syndicate's assets with
        // the manager's profits
        address managerFeeAddress;
        bool syndicateOpen;
        bool distributionsEnabled;
        bool allowlistEnabled;
        bool inactive;
        // Track the creation date in UNIX time. This is also available in the
        // events but the events are tougher to access on chain. This creation
        // date should be relied upon as the source of truth, not the timestamp
        // for the createSyndicate event
        uint256 creationDate;
        // Track the version number for future schema migrations
        uint256 version;
        // Reserve space in the struct so that it is upgrade safe
        // See https://forum.openzeppelin.com/t/how-to-use-a-struct-in-an-upgradable-contract/832/5
        // Gas usage for createSyndicate without reservations: 130549 gwei
        // Gas usage for createSyndicate with reservations: 130549 gwei
        // These reservations consume no gas.
        // There is more info on how empty arrays are handled here:
        // https://www.reddit.com/r/ethereum/comments/7f9xjl/evm_question_static_vs_dynamic_arrays/
        uint256[20] __reservedUint256;
        address[20] __reservedAddress;
    }

    // If you make any changes to SyndicateMappings, ensure that you update getSyndicateMappings
    // as well
    // This struct is separate from the Syndicate settings struct because it contains
    // a mapping. Mappings in structs create a whole host of issues in terms of
    // how they can be returned, so it's convenient to separate the mappings
    // from the rest of the struct
    struct SyndicateMappings {
        // Mapping is the ERC20 contract address -> whether it is available for
        // distributions.
        mapping(address => bool) distributionERC20ContractAddresses;
        // Mapping is the ERC20 contract address -> the amount available as a
        // distribution
        mapping(address => uint256) totalDistributions;
        mapping(address => uint256) totalUnclaimedDistributions;
        // Tracks the amount that an LP has put into a Syndicate
        mapping(address => uint256) deposits;
        // Tracks the amount that an address has claimed for a specific ERC20
        // contract address
        mapping(address => mapping(address => uint256)) claimedDistributions;
        // The addresses that are approved to contribute to the Syndicate
        // The allowlist is enabled when allowlistEnabled is true
        // We don't maintain a specific blocklist because someone could
        // trivially create new addresses
        mapping(address => bool) allowedAddresses;
        // Generic metadata mapping for storing arbitrary data
        mapping(string => string) metadata;
        // Track the version number for future schema migrations
        uint256 version;
        // Reserve space in the struct so that it is upgrade safe
        // See https://forum.openzeppelin.com/t/how-to-use-a-struct-in-an-upgradable-contract/832/5
        mapping(address => uint256) reservedAddressUint256MappingZero;
        mapping(address => uint256) reservedAddressUint256MappingOne;
        mapping(address => uint256) reservedAddressUint256MappingTwo;
        mapping(address => uint256) reservedAddressUint256MappingThree;
        mapping(address => uint256) reservedAddressUint256MappingFour;
        mapping(address => bool) reservedAddressBoolMappingZero;
        mapping(address => bool) reservedAddressBoolMappingOne;
        mapping(address => bool) reservedAddressBoolMappingTwo;
        mapping(address => bool) reservedAddressBoolMappingThree;
        mapping(address => bool) reservedAddressBoolMappingFour;
    }

    // Map a Syndicate manager's address to their Syndicate's settings
    // The mapping's address is determined via the msg.sender that calls createSyndicate
    mapping(address => SyndicateValues) syndicateValues;

    // This mapping must be internal, otherwise you'll get "Stack to deep, try
    // removing local variables" as an error when including a large number of
    // variables in the SyndicateMappings struct. (This first occurred when we added a
    // 16th variable that was not a bool to SingleSyndicate). This is because Solidity
    // attempts to generate automatic getters and setters for the mapping and
    // therefore the struct. The result of this is that we need to create our
    // own getters and setters. We also will be unable to instantiate SingleSyndicate
    // as a local variable inside of any function, which is mitigated by the
    // fact that we always rely on the global syndicateMappings mapping. Being unable to
    // instantiate the local variable in a function also has less practical
    // impact because the struct must be initialized in storage anyway because
    // "Type struct Syndicate.SyndicateMappings is only valid in storage because it
    // contains a (nested) mapping."
    // See https://ethereum.stackexchange.com/questions/64496/is-it-possible-to-have-15-variables-in-a-struct-in-solidity
    // A tip off in solving this was that neither structs nor mappings are
    // passed as values to the function.
    // See https://medium.com/coinmonks/stack-too-deep-error-in-solidity-608d1bd6a1ea
    mapping(address => SyndicateMappings) internal syndicateMappings;

    // Mapping of current managers, true if a wallet is currently managing an
    // Syndicate. Manager wallets are required to be unique to prevent commingling of
    // assets between Syndicates and to ensure that transparency is provided to the
    // LPs
    mapping(address => bool) currentManagers;

    // Events emitted when LPs invest or withdraw from a Syndicate. Used to track LP
    // activity, since that cannot be derived from a mapping (there is no way to
    // search a mapping since it contains all possible addresses initialized to
    // default values)

    /// @notice Emit an event when an LP invests in a Syndicate
    /// @dev This is the only way to search for an LP's Syndicates. The
    /// Syndicates on chain rely on a mapping, so they are not iterable. Instead,
    /// it's necessary to search through an indexed lpAddress off-chain to get a
    /// list of an LP's Syndicates for screens such as the My Syndicates screen.
    /// @dev This must be reconciled with lpWithdrewDepositFromSyndicate to get a
    /// list of all Syndicates that an LP is currently invested in.
    event lpInvestedInSyndicate(
        address indexed lpAddress,
        address indexed syndicateAddress,
        uint256 amountInvested,
        uint256 timestamp
    );

    /// @notice Emit an event when an LP withdraws a deposit from a Syndicate. If
    /// an LP withdraws the full deposit that they originally invested, then they
    /// no longer have any holdings in a specific Syndicate
    /// @dev A separate event is emitted for withdrawing a distribution
    event lpWithdrewDepositFromSyndicate(
        address indexed lpAddress,
        address indexed syndicateAddress,
        uint256 amountWithdrawn,
        address withdrawalERC20ContractAddress,
        uint256 timestamp
    );

    /// @notice Emit an event when an LP withdraws a distribution from a Syndicate
    /// @dev A separate event is emitted for withdrawing a deposit
    event lpWithdrewDistributionFromSyndicate(
        address indexed lpAddress,
        address indexed syndicateAddress,
        uint256 amountWithdrawn,
        address withdrawalERC20ContractAddress,
        uint256 timestamp
    );

    /// @notice Emit an event when a manager associates a memo with a Syndicate
    /// @dev The memos are not stored within this contract directly, only via
    /// this event. They are not recorded within the struct. If a manager wants
    /// to store a value within the struct, they should use `setMetadata()`
    event memo(
        address indexed syndicateAddress,
        address indexed currentManager,
        bytes32 blake2b328HashPartOne,
        bytes32 blake2b328HashPartTwo,
        uint256 timestamp
    );

    /// @notice Only proceed if the msg.sender is the current manager
    modifier rejectIfNotCurrentManager(address syndicateAddress) {
        require(
            msg.sender == syndicateValues[syndicateAddress].currentManager,
            "ERR_SENDER_NOT_CURRENT_MANAGER"
        );
        _;
    }

    /// @notice Only proceed if the Syndicate is open
    modifier onlySyndicateOpen(address syndicateAddress) {
        closeSyndicateIfPastCloseDate(syndicateAddress);
        // Require that the Syndicate is open to continue
        require(
            syndicateValues[syndicateAddress].syndicateOpen,
            "ERR_Syndicate_NOT_OPEN"
        );
        _;
    }

    /// @notice Only proceed if the Syndicate is closed
    modifier onlySyndicateClosed(address syndicateAddress) {
        closeSyndicateIfPastCloseDate(syndicateAddress);
        // Require that the Syndicate is closed to continue
        require(
            !syndicateValues[syndicateAddress].syndicateOpen,
            "ERR_Syndicate_NOT_CLOSED"
        );
        _;
    }

    /// @notice Only proceed if the allowlist is enabled
    modifier onlyAllowlistEnabled(address syndicateAddress) {
        // Require that the Syndicate has an allowlist to continue
        require(
            syndicateValues[syndicateAddress].allowlistEnabled,
            "ERR_ALLOWLIST_NOT_IN_USE"
        );
        _;
    }

    /// @notice Only proceed if the allowlist is disabled
    modifier onlyAllowlistDisabled(address syndicateAddress) {
        // Require that the Syndicate has an allowlist to continue
        require(
            !syndicateValues[syndicateAddress].allowlistEnabled,
            "ERR_ALLOWLIST_IN_USE"
        );
        _;
    }

    /// @notice Set the maximum total deposit a single LP can contribute to the
    /// fund
    function setMaxDeposit(address syndicateAddress, uint256 maxDeposit)
        public
        rejectIfNotCurrentManager(syndicateAddress)
    {
        require(
            maxDeposit >= 0,
            "ERR_MAX_DEPOSIT_MUST_BE_GREATER_THAN_OR_EQUAL_TO_0"
        );
        syndicateValues[syndicateAddress].maxDeposit = maxDeposit;
    }

    /// @notice Set the maximum amount that an SPV can receive in deposits
    function setMaxTotalDeposits(
        address syndicateAddress,
        uint256 maxTotalDeposits
    ) public rejectIfNotCurrentManager(syndicateAddress) {
        require(
            maxTotalDeposits >= 0,
            "ERR_MAX_TOTAL_DEPOSITS_MUST_BE_GREATER_THAN_OR_EQUAL_TO_0"
        );
        syndicateValues[syndicateAddress].maxTotalDeposits = maxTotalDeposits;
    }

    /// @notice Only proceed if the LP attests that they are an accredited
    /// investor. This is to comply with SEC Rule 506(b) of Regulation D
    /// @notice Under Rule 506(b), up to 35 non-accredited investors can invest
    /// in a private placement. These non-accredited investors must have
    /// sufficient knowledge and experience, which is difficult to verify in a
    /// decentralized context. As a result, we leave it up to the Syndicate
    /// manager to track their own list of up to 35 non-accredited investors and
    /// add them to the allowlist. The Syndicate manager must provide disclosures
    /// to non-accredited investors that comply with Regulation A offerings, give
    /// non-accredited investors financial statement information specified in
    /// Rule 506, and be avaialble to answer questions from potential LPs who are
    /// non-accredited investors. This responsibility rests with the Syndicate
    /// manager. See https://www.sec.gov/smallbusiness/exemptofferings/rule506b
    /// @notice Nothing in this documentation should be considered legal
    /// advice. If you are seeking any clarification, please email us at
    /// hello[at]syndicateprotocol.org.
    modifier onlyAccredited(bool accredited) {
        // Require that accredited is true to continue
        require(accredited, "ERR_LP_MUST_BE_ACCREDITED");
        _;
    }

    /// @notice Only proceed if distributions have not been enabled
    modifier onlyBeforeDistributionsEnabled(address syndicateAddress) {
        closeSyndicateIfPastCloseDate(syndicateAddress);
        require(
            !syndicateValues[syndicateAddress].distributionsEnabled,
            "ERR_DISTRIBUTIONS_ALREADY_ENABLED"
        );
        _;
    }

    /// @notice Only proceed after distributions have been enabled
    modifier onlyAfterDistributionsEnabled(address syndicateAddress) {
        closeSyndicateIfPastCloseDate(syndicateAddress);
        require(
            syndicateValues[syndicateAddress].distributionsEnabled,
            "ERR_DISTRIBUTIONS_NOT_ENABLED"
        );
        _;
    }

    /// @notice Close a Syndicate if the current `block.timestamp` is past the
    /// closeDate
    /// @dev This check should always occur before checking if the Syndicate is
    /// open or closed.
    /// @dev Note that the closeDate will update to the current block.timestamp
    /// upon closing the Syndicate.
    function closeSyndicateIfPastCloseDate(address syndicateAddress) internal {
        // Check if a Syndicate is *past* the close date (if the close date is equal
        // to the current block timestamp, the Syndicate will remain open)
        if (
            syndicateValues[syndicateAddress].syndicateOpen == true &&
            block.timestamp > syndicateValues[syndicateAddress].closeDate
        ) {
            syndicateValues[syndicateAddress].syndicateOpen = false;
            syndicateValues[syndicateAddress].closeDate = block.timestamp;
        }
    }

    /// @notice Used by a manager to create a Syndicate with the address of the
    /// `msg.sender`
    /// @param depositERC20ContractAddress The address of the ERC20 used for
    /// deposits (e.g. DAI or USDC's contract addresses) and withdrawals.
    /// Stablecoins are strongly recommended, especially for funds that are open
    /// for an extended period of time. (Otherwise one contributor might
    /// contribute one unit when a token is $100, and another contributor might
    /// contribute one unit when a token is $200, and they would have the same
    /// percentage ownership because they have both contributed one unit of a
    /// token. Stablecoins prevent this because the value is consistent.)
    /// @param syndicateProfitSharePercent The profit share that is sent to the
    /// Syndicate treasury. Syndicate profit share adjusted by PERCENT_MULTIPLE
    /// (set to 10000 ether). For example, the minimum profit share of 0.30%
    /// should be passed in as 30 ether (since it is 0.30% * 10000 ether). This
    /// means that the max precision is 0.01%. There are helpful examples for
    /// common values in the calculateProfitShare within Syndicate.js.
    /// @param closeDate The date that the Syndicate will automatically close in
    /// UNIX time.
    /// @param maxDeposit The max deposit per wallet address.
    /// @param maxTotalDeposits The max deposit amount for the fund/Syndicate.
    /// @param allowlistEnabled False allows contributions to be sent without the
    /// manager needing to allow them. The manager can always reject a
    /// contribution before a Syndicate closes with `rejectLPInvestment()`
    /// @dev The rejectIfNotCurrentManager modifier is not necessary here since
    /// the Syndicate is being initialized and has not been created yet
    /// @dev This function is high risk. If a current Syndicate can be
    /// overwritten, someone could take control of the deposits by changing the
    /// current manager
    /// @dev The address of the Syndicate cannot be changed away from the
    /// msg.sender, but the manager address can be changed
    function createSyndicate(
        address depositERC20ContractAddress,
        uint256 syndicateProfitSharePercent,
        uint256 closeDate,
        uint256 maxDeposit,
        uint256 maxTotalDeposits,
        bool allowlistEnabled
    ) public whenNotPaused() {
        // This requirement is only in place for a Certora Prover check; the 
        // condition should never be met when the contract is deployed to a 
        // real network.
        require(msg.sender != address(0), "ERR_CANNOT_HOLD_FUNDS_AT_ZERO");

        // HIGH RISK: Without this line, a Syndicate can be overwritten and the
        // deposits can be redirected
        require(
            syndicateValues[msg.sender].currentManager == address(0) &&
                currentManagers[msg.sender] == false &&
                !syndicateValues[msg.sender].inactive,
            "ERR_SYNDICATE_ALREADY_EXISTS"
        );

        // Ensure that the closeDate is in the future
        require(
            closeDate > block.timestamp,
            "ERR_CLOSE_DATE_MUST_BE_AFTER_BLOCK_TIMESTAMP"
        );

        // Check that the minimum profit share to Syndicate Protocol is met
        require(
            syndicateProfitSharePercent >= 300 ether,
            "Syndicate profit share must be greater than or equal to 300 (0.3%)"
        );

        // Initialize applicable attributes in syndicateValues
        syndicateValues[msg.sender]
            .depositERC20ContractAddress = depositERC20ContractAddress;
        syndicateValues[msg.sender].maxDeposit = maxDeposit;
        syndicateValues[msg.sender].maxTotalDeposits = maxTotalDeposits;
        syndicateValues[msg.sender].closeDate = closeDate;
        syndicateValues[msg.sender]
            .syndicateProfitSharePercent = syndicateProfitSharePercent;
        syndicateValues[msg.sender].currentManager = msg.sender;
        syndicateValues[msg.sender].syndicateOpen = true;
        syndicateValues[msg.sender].distributionsEnabled = false;
        syndicateValues[msg.sender].inactive = false;
        syndicateValues[msg.sender].allowlistEnabled = allowlistEnabled;
        syndicateValues[msg.sender].creationDate = block.timestamp;
        // Set schema version to V1
        syndicateValues[msg.sender].version = 1;

        // Initialize applicable attributes in syndicateMappings
        syndicateMappings[msg.sender].distributionERC20ContractAddresses[
            depositERC20ContractAddress
        ] = true;
        syndicateMappings[msg.sender].version = 1;

        // Specify that the msg.sender is now managing a fund
        currentManagers[msg.sender] == true;
    }

    /// @notice Used by an LP to invest in a Syndicate
    /// @param syndicateAddress The Syndicate address that the LP is investing in
    /// @param amount The amount of the investment (note that this is calculated
    /// using the primary ERC20 token)
    /// @param accredited Attestation that the LP is an accredited investor. Must
    /// be true to continue. This is to comply with SEC Rule 506(b) of
    /// Regulation D
    /// @dev The LP's investment is tied to their current address via
    /// `msg.sender`. Functionality to transfer LP investments to new owners will
    /// likely be added in the future.
    function lpInvestInSyndicate(
        address syndicateAddress,
        uint256 amount,
        bool accredited
    ) public onlySyndicateOpen(syndicateAddress) onlyAccredited(accredited) {
        if (
            !syndicateValues[syndicateAddress].allowlistEnabled ||
            syndicateMappings[syndicateAddress].allowedAddresses[msg.sender]
        ) {
            // Check if LP Address maxDeposit will be exceeded on deposit
            // ensures LP doesn't deposit more than the Syndicate allows for each address
            require(
                syndicateValues[syndicateAddress].maxDeposit >=
                    SafeMathUpgradeable.add(
                        syndicateMappings[syndicateAddress].deposits[
                            msg.sender
                        ],
                        amount
                    ),
                "ERR_MAX_DEPOSIT_REACHED_FOR_LP_ADDRESS"
            );
            // Check if Syndicate max fund has been reached
            // ensures LP can't deposit beyond the Syndicate threshold
            require(
                syndicateValues[syndicateAddress].maxTotalDeposits >=
                    SafeMathUpgradeable.add(
                        syndicateValues[syndicateAddress].totalDeposits,
                        amount
                    ),
                "ERR_MAX_TOTAL_DEPOSIT_REACHED_FOR_Syndicate"
            );

            processDeposit(
                syndicateAddress,
                syndicateValues[syndicateAddress].currentManager,
                syndicateValues[syndicateAddress].depositERC20ContractAddress,
                amount
            );
        } else {
            require(
                syndicateMappings[syndicateAddress].allowedAddresses[
                    msg.sender
                ],
                "ERR_LP_NOT_ALLOWED"
            );
        }
    }

    /// @notice Used by an LP to withdraw a deposit or distribution from a Syndicate
    /// @param syndicateAddress The Syndicate that an LP wants to withdraw from
    /// @param erc20ContractAddress The ERC 20 address to be transferred from the
    /// manager to the LP.
    /// @param amount The amount to withdraw
    /// @notice The LP is identified via `msg.sender`. This call must be made
    /// from the LP address that originally called lpInvestInSyndicate until the
    /// functionality to transfer LP investments is added
    /// @notice Withdrawal options are different if the Syndicate is open or
    /// closed. If it is open, only the deposit ERC20 can be withdrawn. If it is
    /// closed and distributions are disabled, no ERC20s of any kind can be
    /// withdrawn. If it is closed and distributions are enabled, any ERC20
    /// address can be withdrawn. Distributions are automatically enabled by the
    /// manager when they set a distribution for the first time.
    /// @dev Withdrawals are restricted to the primary or secondary ERC20
    /// contract address. If we allowed any arbitrary ERC20 address, we would
    /// also need to track percentages for each arbitrary ERC20 address. This is
    /// significantly outside of the scope of the Syndicate contract and should be
    /// saved for future asset management contracts
    function lpWithdrawFromSyndicate(
        address syndicateAddress,
        address erc20ContractAddress,
        uint256 amount
    ) public {
        // This check is also handled in processWithdrawal below. We could
        // consider removing it from here
        require(
            erc20ContractAddress ==
                syndicateValues[syndicateAddress].depositERC20ContractAddress ||
                syndicateMappings[syndicateAddress]
                    .distributionERC20ContractAddresses[erc20ContractAddress],
            "ERR_CLOSED_Syndicate_CAN_ONLY_WITHDRAW_DEPOSIT_OR_DISTRIBUTION_ERC20"
        );
        processWithdrawal(syndicateAddress, erc20ContractAddress, amount);
    }

    function setAutoConfirmDeposit(
        address syndicateAddress,
        bool allowlistEnabled
    )
        public
        rejectIfNotCurrentManager(syndicateAddress)
        onlySyndicateOpen(syndicateAddress)
    {
        syndicateValues[syndicateAddress].allowlistEnabled = allowlistEnabled;
    }

    /// @notice Used by a manager to reject an LP investment
    /// @param syndicateAddress The Syndicate that the LP invested in
    /// @param lpAddress The LP whose WHOLE contribution is being returned
    /// @notice This is only used when the allowlist is disabled. When an
    /// allowlist is enabled, LPs have already been pre-approved so there is no
    /// need to reject investments. LPs should have certainty that their
    /// deposits are being accepted when the allowlist is enabled.
    function rejectLPInvestment(address syndicateAddress, address lpAddress)
        public
        rejectIfNotCurrentManager(syndicateAddress)
        onlySyndicateOpen(syndicateAddress)
        onlyAllowlistDisabled(syndicateAddress)
    {
        uint256 returnAmount =
            syndicateMappings[syndicateAddress].deposits[lpAddress];

        // Does not call processWithdrawal because (1) the Syndicate could be
        // paused; and (2) processWithdrawal calls msg.sender (which in this
        // case is the manager, not the investor).

        IERC20Upgradeable primaryERC20 =
            IERC20Upgradeable(
                syndicateValues[syndicateAddress].depositERC20ContractAddress
            );

        primaryERC20.transferFrom(
            syndicateValues[syndicateAddress].currentManager,
            lpAddress,
            returnAmount
        );

        // Decrease the deposits after a transferFrom. The transferFrom will
        // have reverted upon failure, so we can allow this to proceed.

        // Decrease the deposit total for the LP
        syndicateMappings[syndicateAddress].deposits[
            lpAddress
        ] = SafeMathUpgradeable.sub(
            syndicateMappings[syndicateAddress].deposits[lpAddress],
            returnAmount
        );
        // Decrease the total deposits. It's *very important* to keep this
        // in sync with the LP deposits. If these values are out of sync,
        // we cannot calculate percentage ownership of a Syndicate properly.
        syndicateValues[syndicateAddress].totalDeposits = SafeMathUpgradeable
            .sub(syndicateValues[syndicateAddress].totalDeposits, returnAmount);

        // Emit event
        emit lpWithdrewDepositFromSyndicate(
            lpAddress,
            syndicateAddress,
            returnAmount,
            syndicateValues[syndicateAddress].depositERC20ContractAddress,
            block.timestamp
        );
    }

    /// @notice Used by a manager to add an array of LP addresses to the allowlist
    /// @param syndicateAddress The address of the Syndicate that will accept the
    /// allowedAdresses
    /// @param lpAddresses An array of addresses to be allowed by the Syndicate
    /// @notice There are two permission levels for a Syndicate:
    /// @notice 1. Addresses must be pre-approved by the manager and added to the
    /// allowlist before an LP can invest. These will have an event associated
    /// with them to allow for easy searching, but the event has not been created
    /// yet. This is when this function must be used.
    /// @notice 2. All addresses are allowed, and investments can be rejected
    /// after the fact. This is useful if you want to allow anyone to invest in a
    /// Syndicate (for example, for a non-profit might enable this because there
    /// is no expectation of profits and therefore they wouldn't need to be as
    /// concerned about approving every user who contributes to a Syndicate)
    /// @notice Allowing addresses is unnecessary if you pass in
    /// setAutoConfirmDeposit(true). This enables the second permissions option,
    /// where all addresses are allowed by default and can be rejected after the
    /// fact with rejectLPInvestment. As a result, this function only can be used
    /// when the allowlist is enabled.
    /// @dev Allowing a single address costs 31527 in gas without an array and
    /// 32445 in gas with an array. This is a difference in cost of $0.17 at
    /// current gas prices, which is a worthwhile trade off considering that (a)
    /// allowing only one address will be less common than allowing multiple
    /// addresses and (b) having two different allowAddress functions poses a
    /// security risk if we forget to reconcile changes between them
    function allowAddresses(
        address syndicateAddress,
        address[] memory lpAddresses
    )
        public
        rejectIfNotCurrentManager(syndicateAddress)
        onlySyndicateOpen(syndicateAddress)
        onlyAllowlistEnabled(syndicateAddress)
    {
        for (uint256 i = 0; i < lpAddresses.length; i++) {
            syndicateMappings[syndicateAddress].allowedAddresses[
                lpAddresses[i]
            ] = true;
        }
    }

    /// @notice Used by a manager to deny an address that has been previously
    /// added to the allowlist
    /// @param syndicateAddress The address of the Syndicate that contains the
    /// allowlist
    /// @param lpAddress The LP address that should be denied
    /// @notice This function only proceeds when the allowlist is enabled. A
    /// manager cannot deny an address when the allowlist is disabled since there
    /// is an incredible number of possible wallet addresses. Instead, a manager
    /// should use `rejectLPInvestment()`
    /// @notice Denying an LP address that has previously been allowed does not
    /// reject an investment or return a contribution. The deposit is still kept
    /// in the SPV.
    /// @notice All addresses are denied by default when an allowlist is enabled,
    /// so this is only necessary if you want to remove a previously allowed
    /// address
    function denyAddress(address syndicateAddress, address lpAddress)
        public
        rejectIfNotCurrentManager(syndicateAddress)
        onlySyndicateOpen(syndicateAddress)
        onlyAllowlistEnabled(syndicateAddress)
    {
        syndicateMappings[syndicateAddress].allowedAddresses[lpAddress] = false;
    }

    /// @notice Used by the current manager to nominate a new manager
    /// @param syndicateAddress The address of the Syndicate
    /// @param pendingManagerAddress The address of the new manager
    /// @notice The current manager is pending until they claim the
    /// currentManager status. This ensures that the new current manager has
    /// control over their wallet and has also agreed to manage the fund.
    /// @notice Changing a manager does not change the syndicateAddress. The
    /// syndicateAddress is permanent but has no effect beyond acting as an identifier.
    /// @notice To reset a pendingManager request, just set the pendingManager to
    /// be address(0). This is the value that it is initialized at within the
    /// SingleSyndicate struct (it is the default value for all addresses)
    function setPendingManager(
        address syndicateAddress,
        address pendingManagerAddress
    ) public rejectIfNotCurrentManager(syndicateAddress) {
        // Every manager can only manage one Syndicate
        require(
            currentManagers[pendingManagerAddress] == false,
            "ERR_PENDING_MANAGER_ALREADY_MANAGES_ONE_FUND"
        );

        // The current manager cannot set themselves as the pending manager
        // They already manage the Syndicate, so this action doesn't make sense
        require(
            syndicateValues[syndicateAddress].currentManager !=
                pendingManagerAddress,
            "ERR_PENDING_MANAGER_IS_ALREADY_CURRENT_MANAGER"
        );
        // The manager must set a fee address that is different from the
        // manager's address. This is to avoid commingling the Syndicate's assets with
        // the manager's profits
        require(
            pendingManagerAddress !=
                syndicateValues[syndicateAddress].managerFeeAddress,
            "ERR_PENDING_MANAGER_CANNOT_EQUAL_MANAGER_FEE_ADDRESS"
        );
        syndicateValues[syndicateAddress]
            .pendingManager = pendingManagerAddress;
    }

    /// @notice Used by the pending manager to claim current manager status
    /// @param syndicateAddress The address of the Syndicate
    /// @notice The pending manager is identified by `msg.sender`, which proves
    /// that they have control over their address
    /// @notice Changing a manager does not change the syndicateAddress. The
    /// syndicateAddress is permanent but has no effect beyond acting as an
    /// identifier.
    function confirmPendingManager(address syndicateAddress) public {
        // Local variables with a value type (like addresses) are stored in
        // memory. We don't need to (and in fact, cannot) specify this
        // explicitly for addresses
        address oldCurrentManager =
            syndicateValues[syndicateAddress].currentManager;
        address newCurrentManager =
            syndicateValues[syndicateAddress].pendingManager;

        // HIGH RISK: Without this line, anyone could steal a fund from a
        // pendingManager
        require(
            msg.sender == newCurrentManager,
            "ERR_MSG_SENDER_IS_NOT_PENDING_MANAGER"
        );
        require(
            currentManagers[newCurrentManager] == false,
            "ERR_MSG_SENDER_ALREADY_MANAGES_ONE_FUND"
        );
        // The manager must set a fee address that is different from the
        // manager's address. This is to avoid commingling the Syndicate's assets with
        // the manager's profits
        require(
            msg.sender != syndicateValues[syndicateAddress].managerFeeAddress,
            "ERR_MSG_SENDER_CANNOT_EQUAL_MANAGER_FEE_ADDRESS"
        );

        // We use syndicateValues[syndicateAddress].pendingManager here (stored as
        // newCurrentManager) to ensure that a failure of the require statement
        // above does not lead to the fund being stolen by the msg.sender. We do
        // not set the currentManager to be msg.sender, in case we fail to
        // properly check that newCurrentManager is the msg.sender
        syndicateValues[syndicateAddress].currentManager = newCurrentManager;

        currentManagers[newCurrentManager] == true;
        currentManagers[oldCurrentManager] == false;
    }

    /// @notice Used by a manager to set their management and performance fees
    /// @param syndicateAddress The address of the Syndicate to set fees for
    /// @param managerManagementFeePercent The management fee of a Syndicate
    /// manager, calculated per year (e.g. 2% per year, which would be passed in
    /// as 200 ether because the fees are adjusted by PERCENT_MULTIPLE, which is
    /// set to 10000 ether. See the syndicateProfitShare documentation in
    /// `createSyndicate()` for more information on this calculation)
    /// @param managerPerformanceFeePercent The performance fee of a Syndicate
    /// manager, received when an LP makes a withdrawal (e.g. 20% percent per
    /// distribution upon withdrawal, which would be passed in as 2000 ether)
    /// @dev Manager fees can only be set higher while the Syndicate is open to
    /// prevent managers from changing fees on LPs without the ability to act on
    /// those fee changes. The manager can only raise fees while LPs still have
    /// the ability to pull their money out. After the Syndicate is closed, fees
    /// can only be lowered and cannot be raised.
    /// @dev In the future, we will include a timelock on all changes to raise
    /// fees. Since the current architecture requires trust in a manager because
    /// the manager holds the funds, this risk is one that we are willing to
    /// accept in the short-term.
    function setManagerFees(
        address syndicateAddress,
        uint256 managerManagementFeePercent,
        uint256 managerPerformanceFeePercent
    ) public rejectIfNotCurrentManager(syndicateAddress) {
        require(
            managerManagementFeePercent >= 0 &&
                managerPerformanceFeePercent >= 0,
            "ERR_FEES_MUST_BE_GREATER_THAN_OR_EQUAL_TO_0"
        );
        // The manager can only raise the fees after the Syndicate is open
        if (
            managerManagementFeePercent >
            syndicateValues[syndicateAddress].managerManagementFeePercent ||
            managerPerformanceFeePercent >
            syndicateValues[syndicateAddress].managerPerformanceFeePercent
        ) {
            require(
                syndicateValues[syndicateAddress].syndicateOpen,
                "ERR_FEES_CAN_ONLY_BE_LOWERED_Syndicate_MUST_BE_OPEN_TO_RAISE_FEES"
            );
            syndicateValues[syndicateAddress]
                .managerManagementFeePercent = managerManagementFeePercent;
            syndicateValues[syndicateAddress]
                .managerPerformanceFeePercent = managerPerformanceFeePercent;
        }
        // The manager can lower the fees under any conditions. This line will
        // only execute if the fees are less than or equal to the current fees
        else {
            syndicateValues[syndicateAddress]
                .managerManagementFeePercent = managerManagementFeePercent;
            syndicateValues[syndicateAddress]
                .managerPerformanceFeePercent = managerPerformanceFeePercent;
        }
    }

    /// @notice Used by a manager to set the address where fees should be sent
    /// @param syndicateAddress The address of the Syndicate
    /// @param managerFeeAddress The address where manager fees should be sent.
    /// This cannot be the current or pending Syndicate manager
    /// @dev The manager can burn the fees or send them to an address that they
    /// do not own if they'd like, there is no requirement that the
    /// managerFeeAddress cannot equal address(0) or e.g. the address of a
    /// charity
    function setManagerFeeAddress(
        address syndicateAddress,
        address managerFeeAddress
    ) public rejectIfNotCurrentManager(syndicateAddress) {
        // The manager must set a fee address that is different from the
        // manager's address. This is to avoid commingling the Syndicate's assets with
        // the manager's profits
        require(
            managerFeeAddress !=
                syndicateValues[syndicateAddress].currentManager &&
                managerFeeAddress !=
                syndicateValues[syndicateAddress].pendingManager,
            "ERR_MANAGER_FEE_ADDRESS_CANNOT_BE_CURRENT_OR_PENDING_MANAGER"
        );
        syndicateValues[syndicateAddress].managerFeeAddress = managerFeeAddress;
    }

    /// @notice Used by a manager to close a Syndicate to new deposits.
    /// @param syndicateAddress The address of the Syndicate
    /// @notice A Syndicate must be closed before distributions can be redeemed.
    /// @notice Once a Syndicate is closed, it cannot be opened again. This is to
    /// prevent issues with redeeming distributions interacting with new deposits
    /// (e.g. a user with a 10% stake performs a withdrawal, and then a deposit
    /// occurs that dilutes them down to a 1% stake. From that point onward, they
    /// would only be entitled to 1% of the distributions)
    /// @dev Closing a Syndicate updates the closeDate to the current block
    /// timestamp This can be used for calculating management fees or determining
    /// how long the Syndicate has been deploying funds.
    function closeSyndicate(address syndicateAddress)
        public
        rejectIfNotCurrentManager(syndicateAddress)
        onlySyndicateOpen(syndicateAddress)
    {
        syndicateValues[syndicateAddress].syndicateOpen = false;
        syndicateValues[syndicateAddress].closeDate = block.timestamp;
    }

    /// @notice Used by a manager to mark a distribution as available
    /// @param syndicateAddress The address of the Syndicate
    /// @param distributionERC20Address The ERC20 contract address of the
    /// distribution
    /// @param amount The amount of the distribution
    /// @notice If this function is called before distributions are enabled, it
    /// will automatically enable distributions. Once enabled, distributions
    /// cannot be disabled.
    /// @notice Distributions can be set for any ERC20 token, including the
    /// deposit token
    /// @notice A sufficient allowance and balance must be set for the amount
    /// before this can proceed. The currentManager address must give an
    /// allowance greater than or equal to the distribution amount to the
    /// Syndicate contract address. Unlimited allowances are not recommended
    /// because they pose a security risk in case of a vulnerability in the
    /// contract.
    /// @notice Managers only receive performance fees when a user withdraws a
    /// distribution, not when the manager sets the distribution. This prevents
    /// managers from setting a high allowance, taking their fee, and then
    /// cutting off the allowance and not allowing LPs to withdraw.
    function setDistribution(
        address syndicateAddress,
        address distributionERC20Address,
        uint256 amount
    )
        public
        rejectIfNotCurrentManager(syndicateAddress)
        onlySyndicateClosed(syndicateAddress)
    {
        // Enable distributions if they are currently disabled
        if (!syndicateValues[syndicateAddress].distributionsEnabled) {
            syndicateValues[syndicateAddress].distributionsEnabled = true;
        }

        IERC20Upgradeable distributionERC20 =
            IERC20Upgradeable(distributionERC20Address);

        // Check distribution amount is less than or equal to the balance and
        // allowance from the ERC20
        uint256 allowance =
            distributionERC20.allowance(
                syndicateValues[syndicateAddress].currentManager,
                address(this)
            );

        // The -1 check for the allowance handles unlimited approval in the case
        // of DAI. Note that unlimited approval is not recommended for security
        // reasons, since unlimited approval could allow all tokens to be
        // drained in the case of a bug.
        // For more on infinite approval, see the following resources on DAI:
        // https://docs.makerdao.com/smart-contract-modules/dai-module/dai-detailed-documentation#differences-from-erc-20
        // https://github.com/makerdao/dss/blob/e2cdd97046d456b760c1223b5ffb86c540b9e096/src/dai.sol#L78
        // TODO: Review unlimited approval check below to ensure that it is
        // correct. This should be checked in the tests.
        require(
            amount <= allowance || allowance == uint256(-1),
            "ERR_AMOUNT_GREATER_THAN_ALLOWANCE"
        );

        uint256 balance =
            distributionERC20.balanceOf(
                syndicateValues[syndicateAddress].currentManager
            );
        require(amount <= balance, "ERR_AMOUNT_GREATER_THAN_BALANCE");

        // If the allowance and balance checks pass, proceed with marking the distribution as available and emitting an event
        // Only set the distribution ERC20 Contract Address if it was previously unset
        if (
            !syndicateMappings[syndicateAddress]
                .distributionERC20ContractAddresses[distributionERC20Address]
        ) {
            syndicateMappings[syndicateAddress]
                .distributionERC20ContractAddresses[
                distributionERC20Address
            ] = true;
            // TODO: Emit event that a new distribution ERC20 address has been sent
        }

        // HIGH RISK: It is important to keep the total and unclaimed distributions
        // values in sync when a new distribution is added
        syndicateMappings[syndicateAddress].totalDistributions[
            distributionERC20Address
        ] = syndicateMappings[syndicateAddress].totalDistributions[
            distributionERC20Address
        ]
            .add(amount);

        syndicateMappings[syndicateAddress].totalUnclaimedDistributions[
            distributionERC20Address
        ] = syndicateMappings[syndicateAddress].totalUnclaimedDistributions[
            distributionERC20Address
        ]
            .add(amount);
    }

    /// @notice Used by a manager to mark a Syndicate as inactive or active
    /// @param syndicateAddress The address of the Syndicate
    /// @param inactiveStatus The boolean representing whether the Syndicate is
    /// inactive. Set inactiveStatus to true if the Syndicate is inactive.
    /// inactiveStatus is initialized to false upon creation of the Syndicate
    /// @notice This signals that the Syndicate is no longer in use. This only
    /// changes the UI that end users see and has no implications for the
    /// operation of the smart contract. If a manager would like to shut down a
    /// Syndicate, they should close the Syndicate and enable distributions.
    function setSyndicateInactiveStatus(
        address syndicateAddress,
        bool inactiveStatus
    ) public rejectIfNotCurrentManager(syndicateAddress) {
        syndicateValues[syndicateAddress].inactive = inactiveStatus;
    }

    function setMetadata(
        address syndicateAddress,
        string calldata metadataKey,
        string calldata metadataValue
    ) public rejectIfNotCurrentManager(syndicateAddress) {
        syndicateMappings[syndicateAddress].metadata[
            metadataKey
        ] = metadataValue;
    }

    /// @notice Emit an event that references a memo stored as 64 byte hash.
    /// @param syndicateAddress The address of the Syndicate
    /// @param blake2b328HashPartOne The first 32 bytes of the hash
    /// @param blake2b328HashPartTwo The second 32 bytes of the hash
    /// @notice IPFS is recommended. If an IPFS hash is used, it must be
    /// `blake2b-328` so that it can be stored in 64 bytes.
    /// @notice This can be used to store a fund thesis or describe a transaction
    /// that a fund manager made in their wallet. This provides transparency by
    /// notifying LPs of transactions and allowing them to verify the proper use
    /// of funds.
    /// @dev For more on the recommendation to use `blake2b-328` hashes, see
    /// https://medium.com/temporal-cloud/efficient-usable-and-cheap-storage-of-ipfs-hashes-in-solidity-smart-contracts-eb3bef129eba
    function emitMemo(
        address syndicateAddress,
        bytes32 blake2b328HashPartOne,
        bytes32 blake2b328HashPartTwo
    ) public rejectIfNotCurrentManager(syndicateAddress) {
        emit memo(
            syndicateAddress,
            msg.sender,
            blake2b328HashPartOne,
            blake2b328HashPartTwo,
            block.timestamp
        );
    }

    /// @notice Get the values for a Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @return SyndicateValues struct
    /// @dev This function **must** be kept up to date with the web3 UI when
    /// making changes. All PRs that change this function **must** be coordinated
    /// with an engineer on the Web3 Dashboard.
    function getSyndicateValues(address syndicateAddress)
        public
        view
        returns (SyndicateValues memory)
    {
        return syndicateValues[syndicateAddress];
    }

    /// @notice Get the LP info for a Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @param lpAddress The address of the LP whose info is being queried
    /// @return Tuple of:
    /// syndicateMappings[syndicateAddress].deposits[lpAddress],
    /// syndicateMappings[syndicateAddress].claimedDistributions[lpAddress][depositERC20ContractAddress],
    /// syndicateMappings[syndicateAddress].allowedAddresses[lpAddress]
    /// @notice To get the claimed distributiosn for another ERC20, use `getClaimedDistributions()`
    /// @dev This function **must** be kept up to date with the Web3 UI when
    /// making changes. All PRs that change this function **must** be coordinated
    /// with an engineer on the Web3 Dashboard.
    function getSyndicateLPInfo(address syndicateAddress, address lpAddress)
        public
        view
        returns (
            uint256,
            uint256,
            bool
        )
    {
        return (
            syndicateMappings[syndicateAddress].deposits[lpAddress],
            syndicateMappings[syndicateAddress].claimedDistributions[lpAddress][
                syndicateValues[syndicateAddress].depositERC20ContractAddress
            ],
            syndicateMappings[syndicateAddress].allowedAddresses[lpAddress]
        );
    }

    /// @notice Get Sydicate's total distributions per given ERC20
    /// @param syndicateAddress The address of the Syndicate
    /// @param distributionERC20ContractAddress The address of the ERC20
    /// to return total distributions
    /// @return totalDistributions for a given distributionERC20ContractAddress
    function getTotalDistributions(
        address syndicateAddress,
        address distributionERC20ContractAddress
    ) public view returns (uint256) {
        return 
            syndicateMappings[syndicateAddress].totalDistributions[distributionERC20ContractAddress];
    }

    /// @notice Get an LP's claimed distributions for a given ERC20
    /// @param syndicateAddress The address of the Syndicate
    /// @param lpAddress The address of the LP whose info is being queried
    /// @param distributionERC20ContractAddress The address of the ERC20
    /// to return the LP's claimed distributions
    /// @return claimedDistributions by an LP for a given
    /// distributionERC20ContractAddress
    function getClaimedDistributions(
        address syndicateAddress,
        address lpAddress,
        address distributionERC20ContractAddress
    ) public view returns (uint256) {
        return
            syndicateMappings[syndicateAddress].claimedDistributions[lpAddress][
                distributionERC20ContractAddress
            ];
    }

    /// @notice Get an LP's unclaimed distribution for a given ERC20
    /// @param syndicateAddress The address of the Syndicate
    /// @param lpAddress The address of the LP whose info is being queried
    /// @param distributionERC20ContractAddress The address of the ERC20
    /// to return the LP's unclaimed distributions
    /// @return unclaimedDistributions by an LP for a given
    /// distributionERC20ContractAddress
    function getUnclaimedDistributions(
        address syndicateAddress,
        address lpAddress,
        address distributionERC20ContractAddress
    ) public view returns (uint256) {

        uint256 userContributions;
        uint256 totalContributions;
        uint256 claimedDistributions;
        uint256 totalDistributions;

        (userContributions, ,) = getSyndicateLPInfo(syndicateAddress, lpAddress);
        totalContributions = getSyndicateValues(syndicateAddress).totalDeposits;
        claimedDistributions = getClaimedDistributions(
            syndicateAddress,
            lpAddress,
            distributionERC20ContractAddress
        );
        totalDistributions = getTotalDistributions(syndicateAddress, distributionERC20ContractAddress);

        return
            calculateEligibleWithdrawal(
                userContributions,
                totalContributions,
                claimedDistributions,
                totalDistributions
            );
    }

    /// @notice Get the metadata for a given key within a Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @param metadataKey The string that is the key of the metadata to look up
    /// @return metadataValue as a string
    function getSyndicateMetadata(
        address syndicateAddress,
        string calldata metadataKey
    ) public view returns (string memory) {
        return syndicateMappings[syndicateAddress].metadata[metadataKey];
    }

    /// @notice Process a deposit to a Syndicate
    /// @param syndicateAddress The address of the Syndicate
    /// @param depositERC20ContractAddress The ERC20 contract address of the
    /// token that is being used for the deposit
    /// @param amount The amount that the msg.sender is depositing
    /// @dev The onlySyndicateOpen modifier is handled by the methods that call this
    /// (lpInvestInSyndicate). This modifier is a duplicate and could be removed to
    /// save on gas costs, at the expense of possibly introducing bugs in
    /// investing in close Syndicates down the road. For safety's sake, we'll keep it
    /// in for now -- investing in a closed Syndicate causes a whole host of issues,
    /// so it's worth the small increase in gas for the protection that we get
    /// from its presence.
    /// @dev This function is high risk. If the `.transferFrom` line can be
    /// redirected elsewhere, deposits could be stolen. In addition, if the
    /// deposits are not properly tracked, a user could withdraw more than their
    /// allocated share of the distributions.
    function processDeposit(
        address syndicateAddress,
        address currentManagerAddress,
        address depositERC20ContractAddress,
        uint256 amount
    ) internal whenNotPaused() onlySyndicateOpen(syndicateAddress) {
        require(
            depositERC20ContractAddress ==
                syndicateValues[syndicateAddress].depositERC20ContractAddress,
            "ERR_ERC20_DOES_NOT_MATCH_DEPOSIT_ERC20"
        );
        IERC20Upgradeable depositERC20 =
            IERC20Upgradeable(
                syndicateValues[syndicateAddress].depositERC20ContractAddress
            );

        // We could check the allowance first before calling `transferFrom()` if
        // we wanted to, but this would use up more gas. I believe that the
        // `transferFrom()` should cause a revert if the allowance or balance is
        // insufficient, so we don't need to conduct a check here for it. We do
        // need to ensure that everything related to a confirmed transaction
        // occurs after `transferFrom()`

        // HIGH RISK: If we did not use `msg.sender`, this could be used to
        // steal funds from users other than the wallet holder (or smart
        // contract owner, if a DAO is making the deposit).
        depositERC20.transferFrom(msg.sender, currentManagerAddress, amount);

        // Increase the deposits after a transferFrom. The transferFrom will
        // have reverted upon failure, so we can allow this to proceed.

        // Increase the deposit total for the LP
        syndicateMappings[syndicateAddress].deposits[msg.sender] += amount;
        // Increase the total deposits. It's *very important* to keep this in
        // sync with the LP deposits. If these values are out of sync, we cannot
        // calculate percentage ownership of a Syndicate properly
        syndicateValues[syndicateAddress].totalDeposits += amount;

        // Emit LP invested in Syndicate event
        emit lpInvestedInSyndicate(
            msg.sender,
            syndicateAddress,
            amount,
            block.timestamp
        );
    }

    /// @notice Withdraws deposits from an open fund in primary tokens;
    /// transfers distributions from a closed fund in either primary or
    /// secondary tokens.
    /// @param syndicateAddress The address of the Syndicate
    /// @param withdrawalERC20ContractAddress The address of the tokens
    /// awaiting distribution.  This parameter implicitly specifies the type of
    /// distribution (i.e. in primary or secondary tokens) that is being
    /// withdrawn.
    /// @param amount Amount in primary or secondary distribution tokens (as
    /// specified by withdrawalERC20ContractAddress)
    /// @dev This function is high risk. If the `.transferFrom` line can be
    /// redirected elsewhere, withdrawals could be stolen. In addition, if the
    /// withdrawals are not properly tracked, a user could withdraw more than
    /// their allocated share of the distributions.
    function processWithdrawal(
        address syndicateAddress,
        address withdrawalERC20ContractAddress,
        uint256 amount
    ) internal whenNotPaused() {
        // If the Syndicate is open, you can withdraw the primary ERC20 token to take
        // your money back. This is deducted from your deposit. Because you are
        // receiving your money back before there are any profits, there are no
        // fees associated with this action.
        if (syndicateValues[syndicateAddress].syndicateOpen) {
            // Ensure that the primary ERC20 is the only withdrawal option
            // before a fund closes (otherwise a user could take secondary
            // tokens before they are distributed)
            require(
                syndicateValues[syndicateAddress].depositERC20ContractAddress ==
                    withdrawalERC20ContractAddress,
                "ERR_OPEN_Syndicate_CAN_ONLY_WITHDRAW_DEPOSIT_ERC20"
            );

            // HIGH RISK: Without this line, a user could withdraw more than
            // they put into the fund
            require(
                amount <=
                    syndicateMappings[syndicateAddress].deposits[msg.sender],
                "ERR_WITHDRAWAL_AMOUNT_GREATER_THAN_DEPOSIT"
            );

            // Rely on the primaryERC20ContractAddress since that is the only
            // allowed option when a fund is open
            IERC20Upgradeable withdrawalERC20 =
                IERC20Upgradeable(
                    syndicateValues[syndicateAddress]
                        .depositERC20ContractAddress
                );

            // HIGH RISK: If we did not use `msg.sender`, this could be used to
            // redirect funds from users other than the wallet holder (or smart
            // contract owner, if a DAO is making the withdrawal).
            withdrawalERC20.transferFrom(
                syndicateValues[syndicateAddress].currentManager,
                msg.sender,
                amount
            );

            // Decrease the deposits after a transferFrom. The transferFrom will
            // have reverted upon failure, so we can allow this to proceed.

            // Decrease the deposit total for the LP
            syndicateMappings[syndicateAddress].deposits[
                msg.sender
            ] = SafeMathUpgradeable.sub(
                syndicateMappings[syndicateAddress].deposits[msg.sender],
                amount
            );
            // Decrease the total deposits. It's *very important* to keep this
            // in sync with the LP deposits. If these values are out of sync,
            // we cannot calculate percentage ownership of a Syndicate properly.
            syndicateValues[syndicateAddress]
                .totalDeposits = SafeMathUpgradeable.sub(
                syndicateValues[syndicateAddress].totalDeposits,
                amount
            );

            // Keep track of the amount that the LP has withdrawn via an event
            emit lpWithdrewDepositFromSyndicate(
                msg.sender,
                syndicateAddress,
                amount,
                withdrawalERC20ContractAddress,
                block.timestamp
            );
        }
        // If the Syndicate is closed but distributions have not been enabled, the Syndicate
        // manager needs the Syndicates for investment. Therefore, the funds cannot be
        // withdrawn until the Syndicate manager enables distributions.
        else if (
            !syndicateValues[syndicateAddress].syndicateOpen &&
            !syndicateValues[syndicateAddress].distributionsEnabled
        ) {
            revert("ERR_Syndicate_CLOSED_BUT_DISTRIBUTIONS_NOT_ENABLED");
        }
        // If the Syndicate is closed and distributions are enabled, funds can be
        // withdrawn in the primary or secondary ERC20 token. This is added
        // to the sender's claimed distribution totals to track the remaining
        // amount they are eligible to withdraw. Fees are sent to the manager
        // and Syndicate upon withdrawal.
        else if (
            !syndicateValues[syndicateAddress].syndicateOpen &&
            syndicateValues[syndicateAddress].distributionsEnabled
        ) {
            require(
                syndicateMappings[syndicateAddress]
                    .distributionERC20ContractAddresses[
                    withdrawalERC20ContractAddress
                ],
                "ERR_MANAGER_MUST_SET_DISTRIBUTION_FOR_WITHDRAWAL_ERC20"
            );
            // If this error is thrown, then we have not properly
            // tracked totalUnclaimedDistributions[erc20Index].
            require(
                amount <=
                    syndicateMappings[syndicateAddress]
                        .totalUnclaimedDistributions[
                        withdrawalERC20ContractAddress
                    ],
                "ERR_INSUFFICIENT_UNCLAIMED_DISTRIBUTIONS"
            );
            // HIGH RISK: Without this line, a user could withdraw more than
            // they are eligible to.
            require(
                amount <=
                    calculateEligibleWithdrawal(
                        syndicateMappings[syndicateAddress].deposits[
                            msg.sender
                        ],
                        syndicateValues[syndicateAddress].totalDeposits,
                        syndicateMappings[syndicateAddress]
                            .claimedDistributions[msg.sender][
                            withdrawalERC20ContractAddress
                        ],
                        syndicateMappings[syndicateAddress].totalDistributions[
                            withdrawalERC20ContractAddress
                        ]
                    ),
                "ERR_WITHDRAWAL_AMOUNT_GREATER_THAN_ELIGIBLE"
            );

            IERC20Upgradeable withdrawalERC20 =
                IERC20Upgradeable(withdrawalERC20ContractAddress);

            uint256 amountToSyndicate;
            uint256 amountToManager;
            uint256 amountToUser;

            // Tuples are not proper types on Solidity, so we cannot access
            // them by quering the index of the tuple
            // https://docs.soliditylang.org/en/latest/control-structures.html#assignment
            (, amountToSyndicate) = calculateProfitShare(
                amount,
                syndicateValues[syndicateAddress].syndicateProfitSharePercent
            );
            (, amountToManager) = calculateProfitShare(
                amount,
                syndicateValues[syndicateAddress].managerPerformanceFeePercent
            );
            // Get amount by subtracting from the manager and the Syndicate
            // profit shares. This is a protection against errors in the fee
            // calculation.
            amountToUser = amount.sub(amountToSyndicate).sub(amountToManager);

            // Additional sanity check to ensure that the user is not
            // withdrawing an amount greater than what they're entitled to
            // or withdrawing a negative amount. There are cases where a
            // user may withdraw 0 (e.g. If Syndicate or the manager
            // receives 100% of the distributions, in the case of a charity)
            require(
                (amount >= amountToUser && amountToUser >= 0),
                "ERR_AMOUNT_TO_USER_HIGHER_THAN_WITHDRAWAL_AMOUNT_OR_LESS_THAN_ZERO"
            );
            // I believe that there are cases where this can fail (e.g. if
            // there is wei left over from truncating the division). We can
            // catch this during formal verification and determine whether
            // we want to make amount >= instead of == or just give the
            // remaining wei to the user
            require(
                amount ==
                    amountToSyndicate.add(amountToManager).add(amountToUser),
                "WITHDRAWAL_AMOUNT_IS_NOT_EQUAL_TO_TOTAL_AMOUNTS_AFTER_FEES"
            );

            // The user should get paid first, then Syndicate, then the
            // manager. This is because the manager controls the allowance --
            // otherwise the manager could stop someone from getting paid by
            // lowering the allowance below the distribution amount. If the
            // manager wants to get paid, they need to set a proper
            // allowance and not have any of these transfers fail.
            // HIGH RISK: If we did not use `msg.sender`, this could be
            // used to redirect funds from users other than the wallet
            // holder (or smart contract owner, if a DAO is making the
            // withdrawal).
            withdrawalERC20.transferFrom(
                syndicateValues[syndicateAddress].currentManager,
                msg.sender,
                amountToUser
            );

            // Increase the claimed distributions after a transferFrom. The
            // transferFrom will have reverted upon failure, so we can
            // allow this to proceed.
            // HIGH RISK: We increase the amounts after each transferFrom to
            // ensure that the amounts are accurately recorded if a single
            // transferFrom fails. If we increased the amounts after the
            // transferFrom sequence, any one of the transferFrom calls
            // failing would cause the entire withdrawal to go unrecorded
            syndicateMappings[syndicateAddress].claimedDistributions[
                msg.sender
            ][withdrawalERC20ContractAddress] = SafeMathUpgradeable.add(
                syndicateMappings[syndicateAddress].claimedDistributions[
                    msg.sender
                ][withdrawalERC20ContractAddress],
                amountToUser
            );

            // Increase the LP's claimed distributions
            // Subtract from Syndicate's total distributions available.  It is
            // *very important* to keep this in sync with the LP claimed
            // distributions. If these values are out of sync, we cannot
            // calculate percentage ownership of a Syndicate properly.
            syndicateMappings[syndicateAddress].totalUnclaimedDistributions[
                withdrawalERC20ContractAddress
            ] = SafeMathUpgradeable.sub(
                syndicateMappings[syndicateAddress].totalUnclaimedDistributions[
                    withdrawalERC20ContractAddress
                ],
                amountToUser
            );

            // Follow the same transfer process for the Syndicate
            // distribution share
            withdrawalERC20.transferFrom(
                syndicateValues[syndicateAddress].currentManager,
                syndicateValues[syndicateAddress].managerFeeAddress,
                amountToSyndicate
            );

            syndicateMappings[syndicateAddress].claimedDistributions[
                msg.sender
            ][withdrawalERC20ContractAddress] = SafeMathUpgradeable.add(
                syndicateMappings[syndicateAddress].claimedDistributions[
                    msg.sender
                ][withdrawalERC20ContractAddress],
                amountToSyndicate
            );

            withdrawalERC20.transferFrom(
                syndicateValues[syndicateAddress].currentManager,
                syndicateValues[syndicateAddress].managerFeeAddress,
                amountToManager
            );

            syndicateMappings[syndicateAddress].claimedDistributions[
                msg.sender
            ][withdrawalERC20ContractAddress] = SafeMathUpgradeable.add(
                syndicateMappings[syndicateAddress].claimedDistributions[
                    msg.sender
                ][withdrawalERC20ContractAddress],
                amountToManager
            );

            // Keep track of the amount that the LP has withdrawn via an event
            emit lpWithdrewDistributionFromSyndicate(
                msg.sender,
                syndicateAddress,
                amount,
                withdrawalERC20ContractAddress,
                block.timestamp
            );
        }
    }

    /// @notice Calculates the maximum value in distribution tokens (in either
    /// primary or secondary ERC20) that an LP can withdraw based on their
    /// percentage ownership at the moment that the fund closed and the
    /// distributions that they have already received.
    /// @param userContributions Total user has deposited to the fund
    /// @param totalContributions Total contributions (from anyone) to the fund
    /// @param claimedDistributions Value in distributions that user has
    /// withdrawn from the fund already.  Make sure this matches the token type
    /// (primary or secondary) passed in for totalDistributions.
    /// @param totalDistributions Total distributions available from the fund,
    /// claimed or not.  Make sure this matches the token type (primary or
    /// secondary) passed in for claimedDistributions.
    /// @return Value in distributions that user is eligible to withdraw
    /// @dev HIGH RISK: If this calculation is incorrect, a user could withdraw
    /// more or less than they are entitled to.
    function calculateEligibleWithdrawal(
        uint256 userContributions,
        uint256 totalContributions,
        uint256 claimedDistributions,
        uint256 totalDistributions
    ) public pure returns (uint256) {
        // If the fund is empty, we need to return to prevent division by 0
        if (totalContributions == 0) return 0;
        // Solves this equation for eligibleWithdrawal:
        // userContributions / totalContributions = (eligibleWithdrawal +
        //      claimedDistributions) / totalDistributions
        uint256 eligibleWithdrawal =
            SafeMathUpgradeable.sub(
                SafeMathUpgradeable.div(
                    SafeMathUpgradeable.mul(
                        userContributions,
                        totalDistributions
                    ),
                    totalContributions
                ),
                claimedDistributions
            );
        require(eligibleWithdrawal > 0, "ERR_NO_ELIGIBLE_WITHDRAWAL");
        return eligibleWithdrawal;
    }

    /// @param withdrawal Total amount to user is sending
    /// @param profitShareNumerator Establish fractional profit share (decimal
    /// %'s get messy fast). The profit share denominator is always
    /// PROFIT_SHARE_DENOMINATOR, which is set to 10000. Examples of different
    /// percentages can be found in the calculateProfitShare tests
    /// @return Tuple of (withdrawalToUser, withdrawalToProfitShare) The
    /// withdrawal that the user will
    /// receive and the amount of the profit share that the Syndicate treasury
    /// (or, if adapted to asset management, the Syndicate manager) will receive
    /// during withdrawal
    function calculateProfitShare(
        uint256 withdrawal,
        uint256 profitShareNumerator
    ) public pure returns (uint256, uint256) {
        uint256 withdrawalToProfitShare =
            SafeMathUpgradeable.div(
                SafeMathUpgradeable.mul(withdrawal, profitShareNumerator),
                PROFIT_SHARE_DENOMINATOR
            );
        uint256 withdrawalToUser = withdrawal - withdrawalToProfitShare;
        return (withdrawalToUser, withdrawalToProfitShare);
    }

    /// @notice Emergency pause function that can only be triggered by the
    /// contract owner
    /// @notice Its purpose is to pause deposits and withdrawals. All other
    /// functions will work when paused
    function pauseContract() public onlyOwner {
        _pause();
    }

    /// @notice Emergency unpause function that can only be triggered by the
    /// contract owner
    /// @notice Its purpose is to unpause deposits and withdrawals. All other
    /// functions will work when paused
    function unPauseContract() public onlyOwner {
        _unpause();
    }

    /// @notice Renounce ownership of the contract
    /// @notice Unpause the contract before ownership is renounced, to ensure
    /// that deposits/withdrawals are not locked
    function renounceOwnership() public override onlyOwner {
        unPauseContract();
        super.renounceOwnership();
    }

    // Added a storage gap for future variable additions.
    // See https://docs.openzeppelin.com/contracts/3.x/upgradeable#storage_gaps
    uint256[50] __gap;
}

